    const settings = {
        dots: true,
        infinite: true,
        speed: 500,
        slidesToShow: 1,
        slidesToScroll: 1
      };
    return (
        <>
          <section className="slider">
            <Slider {...settings}>
                <div> 
                    <div className="slider-banner"> 

                            <div className="col-md-6 left-slide">
                                dfg
                            </div>
                            <div className="col-md-6 right-slide">
                                <div className="right-banner">
                                    <img src={choose} />
                                </div>
                            </div>

                    </div>
               </div>

            </Slider>
          </section>
        </>
      );
    }

export default SliderExample
